import { 
   RiAncientGateFill,
   RiBriefcase4Fill,
   RiProjector2Fill,
   RiCompasses2Fill,
   RiBrush4Fill,
   RiEditCircleFill
} from "react-icons/ri";

const data = [
   { 
      id: 1,
      icon: <RiAncientGateFill />,
      title: "홍길동은 살아있다.",
      content: "것이다.보라, 인생을 싸인 타오르고 현저하게 이것은 전인 붙잡아 끓는다. 설산에서 얼마나 피는 이상이 붙잡아 두기 인생을 없으면, 위하여 아름다우냐?"
   },
   { 
    id: 2,
    icon: <RiBriefcase4Fill />,
    title: "후쿠시마 시찰단 21일 방일… “오염수 정화 직접 확인",
    content: "것이다.보라, 인생을 싸인 타오르고 현저하게 이것은 전인 붙잡아 끓는다. 설산에서 얼마나 피는 이상이 붙잡아 두기 인생을 없으면, 위하여 아름다우냐?"
   },
   { 
    id: 3,
    icon: <RiProjector2Fill />,
    title: "한강도 야구장도 파라락... 하루살이 떼에 시민들 기겁.",
    content: "것이다.보라, 인생을 싸인 타오르고 현저하게 이것은 전인 붙잡아 끓는다. 설산에서 얼마나 피는 이상이 붙잡아 두기 인생을 없으면, 위하여 아름다우냐?"
   },
   { 
    id: 4,
    icon: <RiCompasses2Fill />,
    title: "마른 목재 갉아먹어...흰개미 강남 출몰",
    content: "것이다.보라, 인생을 싸인 타오르고 현저하게 이것은 전인 붙잡아 끓는다. 설산에서 얼마나 피는 이상이 붙잡아 두기 인생을 없으면, 위하여 아름다우냐?"
   },
   { 
    id: 5,
    icon: <RiBrush4Fill />,
    title: "교사가 자녀 홀로 두고 밤마다 외출",
    content: "것이다.보라, 인생을 싸인 타오르고 현저하게 이것은 전인 붙잡아 끓는다. 설산에서 얼마나 피는 이상이 붙잡아 두기 인생을 없으면, 위하여 아름다우냐?"
   },
   { 
    id: 6,
    icon: <RiEditCircleFill />,
    title: "휴게소서 포착된 점퍼 차림 김남국 5.18에 어디가냐.",
    content: "것이다.보라, 인생을 싸인 타오르고 현저하게 이것은 전인 붙잡아 끓는다. 설산에서 얼마나 피는 이상이 붙잡아 두기 인생을 없으면, 위하여 아름다우냐?"
   }
];
export default data;
